const Home = ({categories}) => {
  return (
    <div>
      <h1>학습 카테고리</h1>
      {/* button으로 name값을 만들어주기 */}
      {
        categories.map((txt,idx)=>{
          return <button key={idx}>{txt.name}</button>
        })
      }
    </div>
  );
};

export default Home;
